import React from "react";

const About = () => {
  return (
    <div>
      <div className=" h-screen  w-[40%] bg-[#E6DACE] "></div>
      <div className="flex justify-center items-center">
        <div className="h-[10%] w-[10%] bg-slate-400 "></div>
        <div></div>
      </div>
    </div>
  );
};

export default About;
